      })
      .then(resp => resp.json())
      .then(data=>console.log(data))
    }, []
  )
  // console.log(lat,lng)
  return(
    <div>
      <SearchBar />
      {/* <Header /> */}
      {/* <RestaurantContainer />  */}
    </div>
  );
}
export default App;
